import React, { useEffect } from 'react';
import './App.css';

function App() {
  async function tester() {
    // let text = await fetch('');

    fetch('http://localhost:8080/college-essay').then((response) => response.json()).then((data) => console.log(data));
  }
  useEffect(() => {
    tester();
  });
  return (

    <div className="App">
        Testing
    </div>
  );
}

export default App;
